expression:
if(
	{[.]../Status/Initializing},
	'Output (CV) held by downstream init',
	if(
		{[.]../Status/Hand},
		'Output (CV) held by local control',
		if(
			{[.]../Status/IntlkCV},
			'Output (CV) held by Interlock',
			if(
				{[.]../Status/Man} && {[.]../CmdSrc/Status/Prog},
				'Output (CV) set by Program',
				if(
					{[.]../Status/Man},
					'Output (CV) set by Operator',
					if(
						{[.]../Status/Auto} && {[.]../CmdSrc/Status/Prog},
						'Controlling to Program setpoint (SP)',
						if(
							{[.]../Status/Auto},
							'Controlling to Operator SP',
							if(
								{[.]../Status/Casc} && {[.]../Config/HasRatio} && ({[.]../Val/Ratio} != 1.0),
								'Controlling to Ratio of Cascade setpoint (SP)',
								if(
									{[.]../Status/Casc} && {[.]../Config/HasRatio},
									'Controlling to Cascade setpoint (SP)',
									if(
										{[.]../Status/Casc},
										'Controlling to Cascade setpoint (SP)',
										''
									)
								)
							)
						)
					)
				)
			)
		)
	)
)
